import React from 'react' 
import supersData from '../src/data/batman.json'

const superheroes = supersData.results[0].members 
const powerstats = superheroes.reduce((acc, superhero) => {
    return (acc.powerstats) > superhero.powerstats ? acc : superhero 

}, {}) 

//ternary operator: condition ? true  : false


function Superheroes(){
return(
<div>
    <h1>Superheroes</h1>
    <h2>Durability: {powerstats.durability}</h2>
    {
        superheroes.map(superhero => {
            return (<p>
                {superhero.name}
            </p>
            )
        })
    }

</div>


)

}

export default Superheroes
